import React from "react";
import VideoThumbnail from './video-thumbnail';
import '../images';


export function ThumbContainer() {
  return <div className="thumb-container">
    <VideoThumbnail video ="../images/video1.jpg" />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
    <VideoThumbnail />
  </div>;
}
